import React from "react";
import { Link } from "react-router-dom";

function Expertise() {
  return (
    <div className="expertise-section">
      <h1>Our Expertise</h1>
      <div className="expertise-list">
        <button className="expertise">
          <Link to="/development">Financial Software Development</Link>
        </button>
        <button className="expertise">
          <Link to="/development">Software for Telecoms</Link>
        </button>
        <button className="expertise">
          <Link to="/development">Startup Development Acceleration</Link>{" "}
        </button>
      </div>
    </div>
  );
}

<Link to="/development"></Link>;

export default Expertise;
